import React from "react";
import { MapPin, Home, Ruler, Square } from "lucide-react";

const PropertyCard = ({ property }) => {
  const { project_name, city, locality, configurations = [], possession_status } = property;
  const firstConfig = configurations[0] || {};
  const firstVariant = firstConfig.variants?.[0] || {};

  return (
    <div className="bg-white rounded-xl shadow-md p-4 border border-gray-200 mb-4">
      <h3 className="text-lg font-bold">{project_name || "N/A"}</h3>
      <div className="text-sm text-gray-600 mb-2">
        <MapPin className="inline w-4 h-4 mr-1" /> {locality || "N/A"}, {city || "N/A"}
      </div>
      <div className="flex space-x-4 text-sm mb-2">
        <div><Home className="inline w-4 h-4 mr-1"/> {firstConfig.bhk || "N/A"}</div>
        <div><Square className="inline w-4 h-4 mr-1"/> {firstVariant.carpet_area || "N/A"}</div>
        <div><Ruler className="inline w-4 h-4 mr-1"/> {firstVariant.price || "N/A"}</div>
      </div>
      <div className="text-xs text-gray-500">{possession_status || "N/A"}</div>
    </div>
  );
};

export default PropertyCard;
